import { AddonNotes, AddonNotesPublishState } from '@addons/notes/services/notes';
import { Component, ViewChild, ElementRef, Input } from '@angular/core';
import { CoreApp } from '@services/app';
import { CoreSites } from '@services/sites';
import { CoreDomUtils, ToastDuration } from '@services/utils/dom';
import { CoreForms } from '@singletons/form';
import { ModalController } from '@singletons';

/**
 * Component that displays a text area for composing a note.
 */
@Component({
    templateUrl: 'add-modal.html',
})
export class AddonNotesAddComponent {

    @ViewChild('itemEdit') formElement?: ElementRef;

    @Input() courseId!: number;
    @Input() userId?: number;
    @Input() type: AddonNotesPublishState = 'personal';
    text = '';
    processing = false;

    /**
     * Send the note or store it offline.
     *
     * @param e Event.
     */
    async addNote(e: Event): Promise<void> {
        e.preventDefault();
        e.stopPropagation();

        CoreApp.closeKeyboard();
        const loadingModal = await CoreDomUtils.showModalLoading('core.sending', true);

        // Freeze the add note button.
        this.processing = true;
        try {
            this.userId = this.userId || CoreSites.getCurrentSiteUserId();
            const sent = await AddonNotes.addNote(this.userId, this.courseId, this.type, this.text);

            CoreForms.triggerFormSubmittedEvent(this.formElement, sent, CoreSites.getCurrentSiteId());

            ModalController.dismiss(<AddonNotesAddModalReturn>{ type: this.type, sent: true }).finally(() => {
                CoreDomUtils.showToast(sent ? 'addon.notes.eventnotecreated' : 'core.datastoredoffline', true, ToastDuration.LONG);
            });
        } catch (error){
            CoreDomUtils.showErrorModal(error);
            this.processing = false;
        } finally {
            loadingModal.dismiss();
        }
    }

    /**
     * Close modal.
     */
    closeModal(): void {
        CoreForms.triggerFormCancelledEvent(this.formElement, CoreSites.getCurrentSiteId());

        ModalController.dismiss(<AddonNotesAddModalReturn>{ type: this.type });
    }

}

export type AddonNotesAddModalReturn = {
    type: AddonNotesPublishState;
    sent?: boolean;
};
<ion-header>
    <ion-toolbar>
        <ion-title>
            <h1>{{ 'addon.notes.addnewnote' | translate }}</h1>
        </ion-title>
        <ion-buttons slot="end">
            <ion-button fill="clear" (click)="closeModal()" [attr.aria-label]="'core.close' | translate">
                <ion-icon name="fas-xmark" slot="icon-only" aria-hidden=true />
            </ion-button>
        </ion-buttons>
    </ion-toolbar>
</ion-header>
<ion-content>
    <form name="itemEdit" (ngSubmit)="addNote($event)" #itemEdit>
        <ion-item>
            <ion-label>{{ 'addon.notes.publishstate' | translate }}</ion-label>
            <ion-select [(ngModel)]="type" name="publishState" interface="popover">
                <ion-select-option value="personal">{{ 'addon.notes.personalnotes' | translate }}</ion-select-option>
                <ion-select-option value="course">{{ 'addon.notes.coursenotes' | translate }}</ion-select-option>
                <ion-select-option value="site">{{ 'addon.notes.sitenotes' | translate }}</ion-select-option>
            </ion-select>
        </ion-item>
        <ion-item>
            <ion-label class="sr-only">{{ 'addon.notes.note' | translate }}</ion-label>
            <ion-textarea placeholder="{{ 'addon.notes.note' | translate }}" rows="5" [(ngModel)]="text" name="text" required="required" />
        </ion-item>
        <div class="ion-padding">
            <ion-button expand="block" type="submit" [disabled]="processing || text.length < 2">
                {{ 'addon.notes.addnewnote' | translate }}
            </ion-button>
        </div>
    </form>
</ion-content>
